BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "charge" (
	"id"	INTEGER NOT NULL,
	"detainee_id"	VARCHAR(255) NOT NULL,
	"case_num"	VARCHAR(255) NOT NULL,
	"description"	VARCHAR(255) NOT NULL,
	"status"	VARCHAR(255) NOT NULL,
	"bail_amount"	VARCHAR(255) NOT NULL,
	"bond_type"	VARCHAR(255) NOT NULL,
	"court_date"	DATE NOT NULL,
	"court_time"	TIME NOT NULL,
	"jurisdiction"	VARCHAR(255) NOT NULL,
	PRIMARY KEY("id"),
	FOREIGN KEY("detainee_id") REFERENCES "detainee_info"("detainee_id")
);
CREATE TABLE IF NOT EXISTS "detainee_info" (
	"detainee_id"	VARCHAR(255) NOT NULL,
	"name"	VARCHAR(255) NOT NULL,
	"height"	VARCHAR(255) NOT NULL,
	"weight"	VARCHAR(255) NOT NULL,
	"sex"	VARCHAR(255) NOT NULL,
	"eyes"	VARCHAR(255) NOT NULL,
	"hair"	VARCHAR(255) NOT NULL,
	"race"	VARCHAR(255) NOT NULL,
	"age"	INTEGER NOT NULL,
	"city"	VARCHAR(255) NOT NULL,
	"state"	VARCHAR(255) NOT NULL,
	PRIMARY KEY("detainee_id")
);
CREATE INDEX IF NOT EXISTS "charge_detainee_id" ON "charge" (
	"detainee_id"
);
COMMIT;
